import React from "react";
import { useSelector } from "react-redux";
export default function Profile() {
  const user = useSelector((state) => state.user.value);
  return (
    <div>
      <h1>pofile page</h1>
      <p>name:{user.name}</p>
      <p>age:{user.age}</p>
      <p>addr:</p>
      <p>fff:</p>
    </div>
  );
}
